import React from 'react';
import './styles.css';
import ProjectCard from '../components/project-cards';
import Reddit0 from '../assets/reddit0.png';
import Reddit1 from '../assets/reddit1.png';
import Reddit2 from '../assets/reddit2.png';
import Sygeplej0 from '../assets/sygeplej0.png';
import Sygeplej1 from '../assets/sygeplej1.png';
import Sygeplej2 from '../assets/sygeplej2.png';
import Physiology0 from '../assets/physiology0.png';
import Physiology1 from '../assets/physiology1.png';
import Physiology2 from '../assets/physiology2.png';
import Pexels0 from '../assets/pexels0.png';
import Pexels1 from '../assets/pexels1.png';
import Pexels2 from '../assets/pexels2.png';

export default function Projects() {
    const reddit = [Reddit0, Reddit1, Reddit2];
    const sygeplej = [Sygeplej0, Sygeplej1, Sygeplej2];
    const physiology = [Physiology0, Physiology1, Physiology2];
    const pexels = [Pexels0, Pexels1, Pexels2];

    return (
        <section className="Body">
            <div id="carouselExampleControls" className="carousel slide" data-ride="carousel">
                <div className="carousel-inner">
                    <div className="carousel-item active">
                        <ProjectCard className="d-block w-100" images={reddit} title="Speed for Reddit" />
                    </div>
                    <div className="carousel-item">
                        <ProjectCard className="d-block w-100" images={pexels} title="Pexels wallpapers" />
                    </div>
                    <div className="carousel-item">
                        <ProjectCard className="d-block w-100" images={sygeplej} title="Sygeplejersken" />
                    </div>
                    <div className="carousel-item">
                        <ProjectCard className="d-block w-100" images={physiology} title="Physiology Calculator" />
                    </div>
                </div>
                <a className="carousel-control-prev" href="#carouselExampleControls" role="button" data-slide="prev">
                    <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                    <span className="sr-only">Previous</span>
                </a>
                <a className="carousel-control-next" href="#carouselExampleControls" role="button" data-slide="next">
                    <span className="carousel-control-next-icon" aria-hidden="true"></span>
                    <span className="sr-only">Next</span>
                </a>
            </div>
        </section>
    )
}
